import React from 'react'
import { HashRouter, Route } from 'react-router-dom'

const PageOne = () => {
  return (
    <div>
      PageOne
      <a href='/pagetwo'>NAvagate to page two</a>

    </div>
  )
}

const PageTwo = () => {
  return (
    <div>
      PageTwo!!!
      <a href='/'><button>NAvagate to page one</button></a>
    </div>
  )
}

class App extends React.Component {
  state = {

  }

  render() {
    return (
      <div className='ui container '>
        <HashRouter>
          <div>
            <Route path='/' exact component={PageOne}/>
            <Route path='/pagetwo' component={PageTwo} />
          </div>
        </HashRouter>
      </div>
    )
  }
}

export default App
